WITH multi_warehouse_orders_cte AS (SELECT ws_order_number FROM web_sales GROUP BY ws_order_number HAVING COUNT(DISTINCT ws_warehouse_sk) > 1), filtered_ws1 AS (SELECT ws1.ws_order_number, ws1.ws_ext_ship_cost, ws1.ws_net_profit FROM web_sales ws1, date_dim, customer_address, web_site WHERE d_date BETWEEN '2002-9-01' AND CAST('2002-9-01' AS DATE) + INTERVAL '60 DAY' AND ws1.ws_ship_date_sk = date_dim.d_date_sk AND ws1.ws_ship_addr_sk = customer_address.ca_address_sk AND customer_address.ca_state IN ('CA','MI','OH','SD','TX','VA') AND ws1.ws_web_site_sk = web_site.web_site_sk AND web_site.web_gmt_offset >= -5 AND ws1.ws_list_price BETWEEN 237 AND 266 AND NOT EXISTS (SELECT 1 FROM web_returns wr1 WHERE wr1.wr_order_number = ws1.ws_order_number AND wr1.wr_reason_sk IN (7,25,26,52,69))), join_multi AS (SELECT filtered_ws1.ws_order_number, filtered_ws1.ws_ext_ship_cost, filtered_ws1.ws_net_profit FROM filtered_ws1 INNER JOIN multi_warehouse_orders_cte ON filtered_ws1.ws_order_number = multi_warehouse_orders_cte.ws_order_number) SELECT COUNT(DISTINCT ws_order_number) AS "order count", SUM(ws_ext_ship_cost) AS "total shipping cost", SUM(ws_net_profit) AS "total net profit" FROM join_multi ORDER BY COUNT(DISTINCT ws_order_number) LIMIT 100